import './App.css';
import { Login, Dashboard, Blog, Contact } from './Components';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import React from 'react';

function Test() {
  return (
    <Route>
      <Route path='test' element={
        <h1>Hello test</h1>
      } />
    </Route>
  );
}

function App() {
  return (
    <div className='App'>
      <BrowserRouter>
        <Routes>
          <Route
            path='/login'
            element={
              <Login></Login>
            } />
          <Route path='/' element={
            <Dashboard />
          } />
          <Route
            path="blog"
            element={
              <Blog />
            } />
          <Route
            path="contact"
            element={
              <Contact />
            } />
          <Route path="*" element={
            <div>
              <h2>404 Page not found</h2>
            </div>
          } />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
